import React from "react";
import "./ProfilePage.css";

const ProfilePage = () => {
  return (
    <div className="profile-page">
      {/* Top Left Panel */}
      <div className="top-left-panel">
        <h2>Top Left Panel</h2>
        <ul>
          <li>Profile Detail 1</li>
          <li>Profile Detail 2</li>
          <li>Profile Detail 3</li>
          <li>Profile Detail 4</li>
          <li>Profile Detail 5</li>
          <li>Profile Detail 6</li>
        </ul>
      </div>

      {/* Top Right Panel */}
      <div className="right-panel top-right">
        <h2>Top Right Panel</h2>
        <ul>
          <li>Upcoming Event 1 - Date: Dec 1, 2024</li>
          <li>Upcoming Event 2 - Date: Dec 10, 2024</li>
          <li>Upcoming Event 3 - Date: Dec 15, 2024</li>
        </ul>
      </div>

      {/* Bottom Right Panel */}
      <div className="right-panel bottom-right">
        <h2>Bottom Right Panel</h2>
        <ul>
          <li>Participated Project A - Status: Completed</li>
          <li>Participated Project B - Status: Ongoing</li>
          <li>Participated Project C - Status: Completed</li>
        </ul>
      </div>
    </div>
  );
};

export default ProfilePage;
